import { CRow } from "@coreui/react";
import Card from "src/Components/UI/Card/Card";
import FormInputLabel from "src/Components/UI/Input/FormInputLabel";
const PersonalInfo = (props) => {
  const data = props.body;
  console.log(data);
  return (
    <Card color="primary" header="Personal Information">
      <CRow>
        <FormInputLabel
          label="First Name"
          type="text"
          readOnly={false}
          md={6}
          sm={12}
        />
        <FormInputLabel
          label="Last Name"
          type="text"
          readOnly={false}
          md={6}
          sm={12}
        />
      </CRow>
      <CRow>
        <FormInputLabel
          label="Email"
          type="email"
          readOnly={true}
          md={7}
          sm={12}
        />
        <FormInputLabel
          label="Phone Number"
          type="text"
          readOnly={false}
          md={5}
          sm={12}
        />
      </CRow>
      <CRow>
        <FormInputLabel
          label="User Role"
          type="text"
          readOnly={true}
          md={7}
          sm={12}
        />
        <FormInputLabel
          label="User Role"
          type="text"
          readOnly={true}
          md={7}
          sm={12}
        />
      </CRow>
    </Card>
  );
};
export default PersonalInfo;
